import "./HeroStyles.css";

function Hero(props) {
  return (
    <>
      <div className="hero">
        <img
          alt="HerpImg"
          src="https://images.unsplash.com/photo-1675870191256-f61699be34a0?q=80&w=2071&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
        />
        <div className="hero-text">
          <h1>Your Journey Your Story</h1>
          <p>Choose Your Favourite Destination.</p>
          <a href="/">Travel Plan</a>
        </div>
      </div>
    </>
  );
}

export default Hero;
